import Navbar from "./components/Navbar";
import Heading from "./components/Headings";
import Intro from "./components/Intro";
import Experience from "./components/Experience";
import Project from "./components/Project";
import Technology from "./components/Technology";
import Contact from "./components/Contact";

function App() {
  return (
    <div className="App">
      <Navbar />

      <Intro />
      <Heading title="Where I’ve worked" />
      <Experience
        title="Frontend Engineer"
        duration="May 2021 – August 2021"
        org="Modumate"
        bullets={[
          [
            "Singlehandedly developed the frontend to facilitate real-time workspace collaboration among multiple users",
          ],
          [
            "Leveraged ",
            <span> Vue and Vuex</span>,
            "to build critical features which improved the user experience of", <span>3000</span>, " enterprise users",
          ],
          ["Diagnosed and refactored the codebase, which opRmized performance and improved rouRng across the website"],
          ["Wrote ", <span>SQL queries</span>, " to improve data handling and streamline the process of collecting user engagement statistics"],
          ["Developed the authentication flow and data validation which significantly improved customer retention"]
          ["Integrated and used ", <span>Google Analytics</span> , " to measure drop off rates and leveraged  ", <span>GKlaviyo to improve user acquisiRon</span>],
        ]}
      />

      <Project />
      <Technology />
      <Contact />
    </div>
  );
}

export default App;
